{"nbformat":4,"nbformat_minor":0,"metadata":{"colab":{"provenance":[]},"kernelspec":{"name":"python3","display_name":"Python 3"},"language_info":{"name":"python"}},"cells":[{"cell_type":"code","execution_count":1,"metadata":{"id":"M34wnlqrPjgw","colab":{"base_uri":"https://localhost:8080/","height":472},"executionInfo":{"status":"ok","timestamp":1740255315007,"user_tz":300,"elapsed":39855,"user":{"displayName":"Matthew Heusmann","userId":"13698582253126517050"}},"outputId":"397f71d5-3e72-41a2-e708-f725ac81597e"},"outputs":[{"output_type":"display_data","data":{"text/plain":["<Figure size 640x480 with 1 Axes>"],"image/png":"\n"},"metadata":{}}],"source":["import numpy as np\n","import matplotlib.pyplot as plt\n","\n","num_bits = 10000000  # Number of bits\n","power = 10**-7  # Received power\n","voltage = np.sqrt(power)  # Voltage representation\n","amplitude = voltage  # Transmitted signal amplitude\n","\n","snr_db_values = np.arange(0, 20, 2)  # SNR in dB steps of 2\n","channel_coefficients = [1, .01, 0.001, 0.0001]  # Defined channel coefficients\n","ber_results = {h: [] for h in channel_coefficients}  # Store BER results\n","\n","for h in channel_coefficients:\n","    for snr_db in snr_db_values:\n","        snr_linear = 10**(snr_db / 10)  # Convert SNR from dB to linear\n","        noise_var = power / snr_linear  # Calculate noise variance\n","\n","        # Generate random bits (0s and 1s)\n","        bits = np.random.randint(0, 2, num_bits)\n","\n","        # Transmit signal (0 -> amplitude, 1 -> -amplitude)\n","        transmitted_signal = np.where(bits == 0, amplitude, -amplitude)\n","\n","        # Apply channel coefficient\n","        if h == 0.0:\n","            # No signal passes through the channel; BER is 1\n","            ber_results[h].append(1.0)\n","            continue\n","\n","        received_signal = h * transmitted_signal  # Apply channel effect\n","\n","        # Generate complex Gaussian noise\n","        noise_real = (1 / np.sqrt(2)) * np.random.normal(0, np.sqrt(noise_var), num_bits)\n","        noise_imag = (1 / np.sqrt(2)) * np.random.normal(0, np.sqrt(noise_var), num_bits)\n","        noise = noise_real + 1j * noise_imag\n","\n","        # Add noise to received signal\n","        received_signal =received_signal+ noise\n","\n","        # Equalization: Avoid division by 0\n","        received_signal /= (h + 1e-10)  # Adding a small value to avoid errors\n","\n","        # Convert received signal to real values\n","        received_signal_real = np.real(received_signal)\n","\n","        # Decode bits: If received value < 0, it's a 1, else it's a 0\n","        decoded_bits = (received_signal_real < 0).astype(int)\n","\n","        # Calculate Bit Error Rate (BER)\n","        bit_errors = np.sum(decoded_bits != bits)\n","        ber = bit_errors / num_bits\n","        ber_results[h].append(ber)\n","\n","# Plot BER vs. SNR for different channel coefficients\n","plt.figure()\n","for h, bers in ber_results.items():\n","    plt.semilogy(snr_db_values, bers, marker='o', linestyle='-', label=f\"Channel Coeff = {h}\")\n","\n","plt.xlabel(\"SNR (dB)\")\n","plt.ylabel(\"Bit Error Rate (BER)\")\n","plt.title(\"BER vs. SNR for Different Channel Coefficients\")\n","plt.legend()\n","plt.grid(True, which='both')\n","plt.show()\n","\n"]}]}